import LandingPage from './pages/LandingPage';
import LoginPage from './pages/LoginPage';
import SigninPage from './pages/SigninPage';
import MvchoPage from './pages/MvchoPage';
import RecomPage from './pages/RecomPage';
import MvdetailPage from './pages/MvdetailPage';
import MyalrPage from './pages/MyalrPage';
import MywishPage from './pages/MywishPage';
import MycalPage from './pages/MycalPage';
import MvsrchPage from './pages/MvsrchPage';
import MvBanner from './pages/MvBanner';

const routes = [
  { path: '/', element: <LandingPage /> },
  { path: '/login', element: <LoginPage /> },
  { path: '/signin', element: <SigninPage /> },
  { path: '/movie-select', element: <MvchoPage /> },
  { path: '/recommendations', element: <RecomPage /> },
  { path: '/movie/:id', element: <MvdetailPage /> },
  { path: '/my/watched', element: <MyalrPage /> },
  { path: '/my/wishlist', element: <MywishPage /> },
  { path: '/my/calendar', element: <MycalPage /> },
  { path: '/movie-search', element: <MvsrchPage /> }
];

export default routes;
